package Tugas;

public class Array {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] data= {20,10,50,30,10};
		System.out.print("Isi data anda adalah: ");
		for (int i=0;i<data.length;i++)
		{
			System.out.print(data[i]+" ");
		}
		System.out.println();

	}

}
